description:
[NeighborAffair] Amanda Tate (18553 / 09.09.2014)

Amanda Tate's neighbor, Bill, is moving out. It's actually a sad day for Amanda because even though she's not going to miss his crazy parties that kept her up, she is going to miss Bill. Bill is going to miss Amanda as well as he's always had a crush on her. Since it's his last day as her neighbor he decides he has nothing left to lose and makes his move. Amanda responds well to his move and they get it on before Bill's final departure from the neighborhood.

